// frontend/src/components/HistoricalView.js
import React, { useState, useEffect } from 'react';
import { getAllResumes, getResumeById } from '../api';
import ResumeDetails from './ResumeDetails';

const HistoricalView = () => {
    const [resumes, setResumes] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const [showModal, setShowModal] = useState(false);
    const [selectedResumeDetails, setSelectedResumeDetails] = useState(null);
    const [modalLoading, setModalLoading] = useState(false);
    const [modalError, setModalError] = useState('');

    useEffect(() => {
        fetchResumes();
    }, []);

    const fetchResumes = async () => {
        setLoading(true);
        setError('');
        try {
            const response = await getAllResumes();
            setResumes(response.data);
        } catch (err) {
            console.error('Error fetching historical resumes:', err);
            setError('Failed to load historical resumes. Please try again.');
        } finally {
            setLoading(false);
        }
    };

    const handleViewDetails = async (id) => {
        setModalLoading(true);
        setModalError('');
        setSelectedResumeDetails(null);
        setShowModal(true);
        try {
            const response = await getResumeById(id);
            setSelectedResumeDetails(response.data.extracted_data);
        } catch (err) {
            console.error('Error fetching resume details:', err);
            setModalError('Failed to load resume details. Please try again.');
        } finally {
            setModalLoading(false);
        }
    };

    const closeModal = () => {
        setShowModal(false);
        setSelectedResumeDetails(null);
        setModalError('');
    };

    return (
        <div className="historical-view-container">
            <h2>Previously Analyzed Resumes</h2>
            {loading && <p>Loading historical resumes...</p>}
            {error && <div className="error-message">{error}</div>}

            {!loading && !error && resumes.length === 0 && (
                <p>No resumes have been analyzed yet. Upload one in the "Resume Analysis" tab!</p>
            )}

            {!loading && !error && resumes.length > 0 && (
                <table>
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th>File Name</th>
                            <th>Applicant Name</th>
                            <th>Upload Date</th>
                            <th>Action</th>
                        </tr>
                    </thead>
                    <tbody>
                        {resumes.map((resume) => (
                            <tr key={resume.id}>
                                <td>{resume.id}</td>
                                <td>{resume.filename}</td>
                                <td>{resume.name || 'N/A'}</td>
                                <td>{new Date(resume.upload_date).toLocaleString()}</td>
                                <td>
                                    <button className="button" onClick={() => handleViewDetails(resume.id)}>
                                        Details
                                    </button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}

            {showModal && (
                <div className="modal">
                    <div className="modal-content">
                        <span className="close-button" onClick={closeModal}>&times;</span>
                        {modalLoading && <p>Loading details...</p>}
                        {modalError && <div className="error-message">{modalError}</div>}
                        {selectedResumeDetails && <ResumeDetails data={selectedResumeDetails} />}
                    </div>
                </div>
            )}
        </div>
    );
};

export default HistoricalView;
